import React from "react";

const EmotionItem: React.FC<{ emotion_id: number; emotion_img: string; emotion_des: string }> = ({
    emotion_id,
    emotion_img,
    emotion_des,
}) => {
    return (
        <div>
            <img src={emotion_img} />
            <span>{emotion_des}</span>
        </div>
    );
};

export default EmotionItem;
